export default function LoginAdmin() {
  let pageContent = "";
  pageContent = (
    <div>
      <div>
        <h3>Login for administrator</h3>
        <p>Login for administrato</p>
      </div>
    </div>
  );
  return <div>{pageContent}</div>;
}
